import Foundation

class LibraryPresenter {
    
    private var books: [Book] = []
    private var authors: [Author] = []
    private var categories: [String] = []
    
    
    func loadData() {
        categories = getCategories()
        authors = getMockAuthors()
        books = getMockBooks()
    }
    
    func getSectionsCount() -> Int {
        return authors.count
    }
    
    func getBooksForSection(sectionIndex: Int) -> [Book] {
        return books.filter { book in
            book.author == authors[sectionIndex].name
        }
    }
    
    func getBook(forRowAt: IndexPath) -> Book {
        return books.filter { book in
            book.author == authors[forRowAt.section].name
        }[forRowAt.row]
    }
}

extension LibraryPresenter {
    
    private func getMockAuthors() -> [Author] {
        return [
            Author(name: "Brandon Sanderson", biography: ""),
            Author(name: "Friedrich Nietzsche", biography: ""),
            Author(name: "Chuck Palahniuk", biography: "")
        ]
    }
    
    private func getMockBooks() -> [Book] {
        
        return [
            Book(author: authors[0].name, cathegory: .Ciencia_Ficcion, title: "Elantris", coverImageData: ""),
            Book(author: authors[0].name, cathegory: .Ciencia_Ficcion, title: "El Imperio Final", coverImageData:""),
            Book(author: authors[0].name, cathegory: .Ciencia_Ficcion, title: "The Well of Ascension", coverImageData: ""),
            Book(author: authors[1].name, cathegory: .Filosofia, title: "As hablo Zaratustra", coverImageData: ""),
            Book(author: authors[1].name, cathegory: .Filosofia, title: "El anticristo", coverImageData: ""),
            Book(author: authors[1].name, cathegory: .Filosofia, title: "Escritos pstumos", coverImageData: ""),
            Book(author: authors[2].name, cathegory: .Filosofia, title: "El club de la lucha", coverImageData: ""),
            Book(author: authors[2].name, cathegory: .Filosofia, title: "Asfixia", coverImageData: ""
                )
        ]
    }
    
    private func getCategories() -> [String] {
        var retCategories : [String] = []
        Category.allCases.forEach { category in
            retCategories.append(category.rawValue.replacing("_", with: " "))
        }
        return retCategories
    }
}
